<!DOCTYPE html>
<html lang="en">
  <head>
    <meta charset="UTF-8" />
    <meta http-equiv="X-UA-Compatible" content="IE=edge" />
    <meta name="viewport" content="width=device-width, initial-scale=1.0" />
    <title>Logo Animation</title>

    <style>
      * {
        margin: 0;
        padding: 0;
        box-sizing: border-box;
      }

      .parentDiv {
        min-height: 100vh;
        display: grid;
        place-items: center;
        background-color: lightcoral;
      }

      #center-logo,
      #text-1,
      #text-2,
      #text-3,
      #text-4 {
        transform-box: fill-box;
        transform-origin: center;
      }

      #center-logo {
        animation: heartBeat 1s ease-in-out infinite alternate forwards;
      }

      @keyframes heartBeat {
        from {
          transform: scale(1);
        }

        to {
          transform: scale(1.05);
        }
      }

      #text-1 {
        opacity: 0;
        animation: fadeIn1 10s ease-in-out infinite forwards;
      }

      @keyframes fadeIn1 {
        0%,
        10% {
          opacity: 0;
        }
        20% {
          opacity: 1;
        }
        100% {
          opacity: 1;
        }
      }

      #text-2 {
        opacity: 0;
        animation: fadeIn2 10s ease-in-out infinite forwards;
      }

      @keyframes fadeIn2 {
        0%,
        30% {
          opacity: 0;
        }

        40% {
          opacity: 1;
        }
        100% {
          opacity: 1;
        }
      }

      #text-3 {
        opacity: 0;
        animation: fadeIn3 10s ease-in-out infinite forwards;
      }

      @keyframes fadeIn3 {
        0%,
        50% {
          opacity: 0;
        }

        60% {
          opacity: 1;
        }
        100% {
          opacity: 1;
        }
      }

      #text-4 {
        opacity: 0;
        animation: fadeIn4 10s ease-in-out infinite forwards;
      }

      @keyframes fadeIn4 {
        0%,
        70% {
          opacity: 0;
        }
        80% {
          opacity: 1;
        }
        100% {
          opacity: 1;
        }
      }

      #top-right-dots {
        clip-path: polygon(0 0, 100% 0, 100% 0%, 0 0%);
        animation: appear1 10s ease-in-out 1s infinite forwards;
      }

      @keyframes appear1 {
        0%,
        10% {
          clip-path: polygon(0 0, 100% 0, 100% 0%, 0 0%);
        }
        20% {
          clip-path: polygon(0 0, 100% 0, 100% 100%, 0 100%);
        }
        100% {
          clip-path: polygon(0 0, 100% 0, 100% 100%, 0 100%);
        }
      }

      #bottom-right-dots {
        clip-path: polygon(0 0, 100% 0, 100% 0%, 0 0%);
        animation: appear2 10s ease-in-out 1s infinite forwards;
      }

      @keyframes appear2 {
        0%,
        30% {
          clip-path: polygon(0 0, 100% 0, 100% 0%, 0 0%);
        }

        40% {
          clip-path: polygon(0 0, 100% 0, 100% 100%, 0 100%);
        }
        100% {
          clip-path: polygon(0 0, 100% 0, 100% 100%, 0 100%);
        }
      }

      #bottom-left-dots {
        clip-path: polygon(0 100%, 100% 100%, 100% 100%, 0 100%);
        animation: appear3 10s ease-in-out 1s infinite forwards;
      }

      @keyframes appear3 {
        0%,
        50% {
          clip-path: polygon(0 100%, 100% 100%, 100% 100%, 0 100%);
        }

        60% {
          clip-path: polygon(0 0%, 100% 0%, 100% 100%, 0 100%);
        }
        100% {
          clip-path: polygon(0 0%, 100% 0%, 100% 100%, 0 100%);
        }
      }

      #top-left-dots {
        clip-path: polygon(0 100%, 100% 100%, 100% 100%, 0 100%);
        animation: appear4 10s ease-in-out 1s infinite forwards;
      }

      @keyframes appear4 {
        0%,
        70% {
          clip-path: polygon(0 100%, 100% 100%, 100% 100%, 0 100%);
        }
        80% {
          clip-path: polygon(0 0%, 100% 0%, 100% 100%, 0 100%);
        }
        100% {
          clip-path: polygon(0 0%, 100% 0%, 100% 100%, 0 100%);
        }
      }
    </style>
